// SPDX-License-Identifier: MIT

pragma solidity ^0.7.5;
pragma abicoder v2;

import '@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol';
import '@uniswap/v3-periphery/contracts/interfaces/INonfungiblePositionManager.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract LiquidityProvider {
    address public owner;
    ISwapRouter public uniswapRouter;
    INonfungiblePositionManager public positionManager;

    constructor(address _uniswapRouterAddress, address _positionManagerAddress) {
        owner = msg.sender;
        uniswapRouter = ISwapRouter(_uniswapRouterAddress);
        positionManager = INonfungiblePositionManager(_positionManagerAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    function provideLiquidity(
        address tokenA,
        address tokenB,
        uint24 fee,
        int24 tickLower,
        int24 tickUpper,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        uint256 deadline
    ) external onlyOwner returns (uint256 tokenId) {
        // Approve the position manager to spend the tokens
        IERC20(tokenA).approve(address(positionManager), amountADesired);
        IERC20(tokenB).approve(address(positionManager), amountBDesired);

        // Mint a new position
        INonfungiblePositionManager.MintParams memory params = INonfungiblePositionManager.MintParams({
            token0: tokenA,
            token1: tokenB,
            fee: fee,
            tickLower: tickLower,
            tickUpper: tickUpper,
            amount0Desired: amountADesired,
            amount1Desired: amountBDesired,
            amount0Min: amountAMin,
            amount1Min: amountBMin,
            recipient: address(this),
            deadline: deadline
        });

        (tokenId,,,) = positionManager.mint(params);
    }

    // Função para retirar tokens acidentalmente enviados para o contrato
    function rescueTokens(address token, uint amount) external onlyOwner {
        IERC20(token).transfer(owner, amount);
    }

    function transferTokenAToContract(address tokenAAddress, uint amount) external onlyOwner returns (bool) {
        return IERC20(tokenAAddress).transferFrom(msg.sender, address(this), amount);
    }

    function transferTokenBToContract(address tokenBAddress, uint amount) external onlyOwner returns (bool) {
        return IERC20(tokenBAddress).transferFrom(msg.sender, address(this), amount);
    }

    function balance(address tokenAddress) external view returns (uint) {
        return IERC20(tokenAddress).balanceOf(address(this));
    }

    // Função para remover liquidez de uma posição específica
    function removeLiquidity(uint256 tokenId, uint128 liquidity, uint256 amount0Min, uint256 amount1Min, uint256 deadline) external onlyOwner {
        INonfungiblePositionManager.DecreaseLiquidityParams memory params = INonfungiblePositionManager.DecreaseLiquidityParams({
            tokenId: tokenId,
            liquidity: liquidity,
            amount0Min: amount0Min,
            amount1Min: amount1Min,
            deadline: deadline
        });

        positionManager.decreaseLiquidity(params);
    }

    // Função para coletar tokens de uma posição após a remoção da liquidez
    function collectTokens(uint256 tokenId, uint128 amount0Max, uint128 amount1Max, address recipient) external onlyOwner {
        INonfungiblePositionManager.CollectParams memory params = INonfungiblePositionManager.CollectParams({
            tokenId: tokenId,
            recipient: recipient,
            amount0Max: amount0Max,
            amount1Max: amount1Max
        });

        positionManager.collect(params);
    }
}

